#!/usr/bin/perl

use strict;
use warnings;

use constant FALSE => (0 == 1);
use constant TRUE  => (1 == 1);


my $dataset = (shift || 'bad');

while (my $line = <DATA>) {
  last if $line =~ /^### \Q$dataset\E/;
}

my $bits;

while (my $line = <DATA>) {
  last if $line =~ /^###/;

  $line =~ tr/X-//cd;
  $line =~ tr/X-/10/;
  $bits .= $line;
}


my $time = 0;

sub delay
{
  $time += $_[0];
}

sub digitalRead
{
  my $offset = int($time / 10);
  exit if $offset >= length($bits);
  return (substr($bits, $offset, 1) eq '1' ? 1 : 0);
}

sub sum
{
  my $sum = 0;
  $sum += shift
    while @_;
  return $sum;
}

sub decodeBits
{
  my $result = 0;
  $result = ($result << 1) + pop
    while @_;
  return $result;
}

my $nSecondToAverage = 15;
my $nSampleInSecond = 32;
my @sumSample = (0) x $nSampleInSecond;

my $nSampleLead       = 3;  ## int($nSampleInSecond / 10);
my $nSamplePulseStart = 3;  ## int($nSampleInSecond / 10);
my $nSamplePulseEnd   = 3;  ## int($nSampleInSecond / 10 + 0.5);
my $nSampleTrail      = 1;  ## int($nSampleInSecond / 10 * 2);

my $nSampleWindow = $nSampleLead + $nSamplePulseStart + $nSamplePulseEnd + $nSampleTrail;

my $thresholdZero   = 1;  ## int(($nSampleLead + $nSamplePulseStart + $nSampleTrail) * 0.8) - $nSampleLead;
my $thresholdMinute = 5;  ## int($nSampleWindow                                      * 0.9) - $nSampleLead;

my $memory =
    $nSampleInSecond / int(8 / int(log($nSecondToAverage) / log(2) + 1))  # @sumSample
  + int(($nSecondToAverage * $nSampleInSecond + 7) / 8)                   # @sample
  + int(($nSampleWindow                       + 7) / 8)                   # @sampleWindowAveraged
  + int(($nSampleWindow                       + 7) / 8)                   # @samplePulse
  + 4                                                                     # $timeEdge
  + int((59 + 1                               + 7) / 8);                  # @bit + $nextPulseStartsMinute

printf "INFO:  nSampleLead       = %d\n", $nSampleLead;
printf "INFO:  nSamplePulseStart = %d\n", $nSamplePulseStart;
printf "INFO:  nSamplePulseEnd   = %d\n", $nSamplePulseEnd;
printf "INFO:  nSampleTrail      = %d\n", $nSampleTrail;
printf "INFO:  nSampleWindow     = %d\n", $nSampleWindow;
printf "INFO:  thresholdMinute   = %d\n", $thresholdMinute;
printf "INFO:  thresholdZero     = %d\n", $thresholdZero;
printf "INFO:  memory            = %d\n", $memory;
print "\n";

my @sample               = (0) x ($nSecondToAverage * $nSampleInSecond);
my @sampleWindowAveraged = (0) x $nSampleWindow;
my @samplePulse          = (0) x $nSampleWindow;

my $timeEdge            = 0;
my $timeEdgeSpeculative = 0;

my @bit = ();
my $nextPulseStartsMinute = FALSE;

my @sampleWindowAveragedLookbehind = (0) x $nSampleWindow;

my $timeDecodeLast    = 0;
my $daytimeDecodeLast = undef;

my $nDecodeOk  = 0;
my $nDecodeBad = 0;

=cut
for (;;) {
  my $sample = digitalRead();
  print $sample;
  delay(1000 / $nSampleInSecond);
}
=cut

for (my $iSample = 0; ; $iSample = ($iSample + 1) % @sample) {
  my $iSampleInSecond = $iSample % $nSampleInSecond;

  $sumSample[$iSampleInSecond] -= $sample[$iSample];
  $sample[$iSample] = digitalRead();
  $sumSample[$iSampleInSecond] += $sample[$iSample];

  push @samplePulse, $sample[$iSample];
  shift @samplePulse
    while @samplePulse > $nSampleWindow;

  my $sampleAveraged = ($sumSample[$iSampleInSecond] > $nSecondToAverage / 2 ? 1 : 0);

  push @sampleWindowAveraged, $sampleAveraged;
  push @sampleWindowAveragedLookbehind, shift @sampleWindowAveraged
    while @sampleWindowAveraged > $nSampleWindow;

  shift @sampleWindowAveragedLookbehind
    while @sampleWindowAveragedLookbehind > $nSampleWindow;

  my @match = @sampleWindowAveraged;
  my $match = 0;

  grep { $match += (shift(@match) == 1) } (1 .. $nSampleLead);
  grep { $match += (shift(@match) == 0) } (1 .. $nSamplePulseStart);

  if ($match == $nSampleLead + $nSamplePulseStart) {
    my $msecSinceLastEdge = $time - $timeEdge;

    if ($msecSinceLastEdge < 500) {
      # ignore this edge
    }
    else {
      if ($msecSinceLastEdge > 1500) {
        # missed at least one edge
        # rather unlikely since we're averaging so much
        @bit = ();

        printf "%11.3f:    ERROR: Missed pulse (%d msec since last)\n", $time / 1000, $msecSinceLastEdge;
      }

      $timeEdge = $time;

      my $sumSamplePulse = sum(@samplePulse[$nSampleLead .. $#samplePulse]);

      if ($sumSamplePulse > $thresholdMinute) {
        # no pulse at all: end-of-minute marker
        $nextPulseStartsMinute = TRUE;
      }
      else {
        if ($nextPulseStartsMinute) {
          if (@bit == 59) {
            my @error;

            printf "%11.3f:  timebits %s\n", $time / 1000, join('', @bit);

            if ($bit[0] != 0) {
              printf "            bit  0    = %-23s  ERROR: Start of minute must be 0\n", $bit[0];
              push @error, 'start-minute';
            }

            # bit 1-14: MeteoTime weather information
            # bit 15: call bit
            # bit 16: if 1, change daylight saving at end of this hour

            # bit 17: if 1, is CEST
            # bit 18: if 1, is CET

            my $summertime =
                $bit[17] == 1 && $bit[18] == 0 ? TRUE
              : $bit[17] == 0 && $bit[18] == 1 ? FALSE : undef;

            if (not defined $summertime) {
              printf "            bit 17-18 = %-23s  ERROR: Daylight savings must either be 10 (CEST) or 01 (CET)\n", $bit[17] . $bit[18];
              push @error, 'dst';
            }

            # bit 19: add leap second at end of this hour

            if ($bit[20] != 1) {
              printf "            bit 20    = %-23s  ERROR: Start of time data must be 1\n", $bit[20];
              push @error, 'start-time';
            }

            # bit 21-24: minute % 10; validate range (actual: 0..15, expected: 0..9)
            # bit 25-27: minute / 10; validate range (actual: 0..7,  expected: 0..5)

            my $digitMinute01 = decodeBits(@bit[21 .. 24]);

            if ($digitMinute01 > 9) {
              printf "            bit 21-24 = %-23s  ERROR: Minute 01-digit out of range (0..9, got %d)\n", join('', @bit[21 .. 24]), $digitMinute01;
              push @error, 'minute-01-range';
            }

            my $digitMinute10 = decodeBits(@bit[25 .. 27]);

            if ($digitMinute10 > 5) {
              printf "            bit 25-27 = %-23s  ERROR: Minute 10-digit out of range (0..5, got %d)\n", join('', @bit[25 .. 27]), $digitMinute10;
              push @error, 'minute-10-range';
            }

            my $minute = $digitMinute10 * 10 + $digitMinute01;

            # bit 28: minute parity (1 if odd number of bits in 21-27)

            my $okayMinute = (sum(@bit[21 .. 27], $bit[28]) % 2 == 0);

            if (not $okayMinute) {
              printf "            bit 21-28 = %-23s  ERROR: Parity error in minute\n", join('', @bit[21 .. 28]);
              push @error, 'minute-parity';
            }

            # bit 29-32: hour % 10; validate range (actual: 0..15, expected: 0..9)
            # bit 33-34: hour / 10; validate range (actual: 0..3,  expected: 0..2)

            my $digitHour01 = decodeBits(@bit[29 .. 32]);

            if ($digitHour01 > 9) {
              printf "            bit 29-32 = %-23s  ERROR: Hour 01-digit out of range (0..9, got %d)\n", join('', @bit[29 .. 32]), $digitHour01;
              push @error, 'hour-01-range';
            }

            my $digitHour10 = decodeBits(@bit[33 .. 34]);

            if ($digitHour10 > 2) {
              printf "            bit 33-34 = %-23s  ERROR: Hour 10-digit out of range (0..2, got %d)\n", join('', @bit[33 .. 34]), $digitHour10;
              push @error, 'hour-10-range';
            }

            my $hour = $digitHour10 * 10 + $digitHour01;

            if ($hour > 23) {
              printf "            bit 29-34 = %-23s  ERROR: Hour out of range (0..23, got %d)\n", join('', @bit[29 .. 34]), $hour;
              push @error, 'hour-range';
            }
 
            # bit 35: hour parity (1 if odd number of bits in 29-34)

            my $okayHour = (sum(@bit[29 .. 34], $bit[35]) % 2 == 0);

            if (not $okayHour) {
              printf "            bit 29-35 = %-23s  ERROR: Parity error in hour\n", join('', @bit[29 .. 35]);
              push @error, 'hour-parity';
            }

            # bit 36-39: day of month % 10; validate range (actual: 0..15, expected: 0..9)
            # bit 40-41: day of month / 10

            my $digitDay01 = decodeBits(@bit[36 .. 39]);

            if ($digitDay01 > 9) {
              printf "            bit 36-39 = %-23s  ERROR: Day 01-digit out of range (0..9, got %d)\n", join('', @bit[36 .. 39]), $digitDay01;
              push @error, 'day-01-range';
            }

            my $digitDay10 = decodeBits(@bit[40 .. 41]);

            my $day = $digitDay10 * 10 + $digitDay01;

            if ($day < 1 or $day > 31) {
              printf "            bit 36-41 = %-23s  ERROR: Day out of range (1..31, got %d)\n", join('', @bit[36 .. 41]), $day;
              push @error, 'day-range';
            }
 
            # bit 42-44: day of week (1 = Mon, 7 = Sun)

            my $weekday = decodeBits(@bit[42 .. 44]);

            if ($weekday < 1 or $weekday > 7) {
              printf "            bit 42-44 = %-23s  ERROR: Weekday out of range (1..7, got %d)\n", join('', @bit[42 .. 44]), $weekday;
              push @error, 'weekday-range';
            }

            # bit 45-48: month % 10; validate range (actual: 0..15, expected: 0..9)
            # bit 49:    month / 10

            my $digitMonth01 = decodeBits(@bit[45 .. 48]);

            if ($digitMonth01 > 9) {
              printf "            bit 45-48 = %-23s  ERROR: Month 01-digit out of range (0..9, got %d)\n", join('', @bit[45 .. 48]), $digitMonth01;
              push @error, 'month-01-range';
            }

            my $digitMonth10 = decodeBits($bit[49]);

            my $month = $digitMonth10 * 10 + $digitMonth01;

            if ($month < 1 or $month > 12) {
              printf "            bit 45-49 = %-23s  ERROR: Month out of range (1..12, got %d)\n", join('', @bit[45 .. 49]), $month;
              push @error, 'month-range';
            }

            # bit 50-53: year % 10; validate range (actual: 0..15, expected: 0..9)
            # bit 54-57: year / 10; validate range (actual: 0..15, expected: 0..9)

            my $digitYear01 = decodeBits(@bit[50 .. 53]);

            if ($digitYear01 > 9) {
              printf "            bit 50-53 = %-23s  ERROR: Year 01-digit out of range (0..9, got %d)\n", join('', @bit[50 .. 53]), $digitYear01;
              push @error, 'year-01-range';
            }

            my $digitYear10 = decodeBits(@bit[54 .. 57]);

            if ($digitYear10 > 9) {
              printf "            bit 54-57 = %-23s  ERROR: Year 10-digit out of range (0..9, got %d)\n", join('', @bit[54 .. 57]), $digitYear10;
              push @error, 'year-10-range';
            }

            my $year = $digitYear10 * 10 + $digitYear01;

            # bit 58: date parity (1 if odd number of bits in 36-57)

            my $okayDate = (sum(@bit[36 .. 57], $bit[58]) % 2 == 0);

            if (not $okayDate) {
              printf "            bit 36-58 = %-23s  ERROR: Parity error in date\n", join('', @bit[36 .. 58]);
              push @error, 'date-parity';
            }

            # calculate weekday from date (assuming 20XX), compare to $weekday
            # see https://en.wikipedia.org/wiki/Julian_day#Converting_Julian_or_Gregorian_calendar_date_to_Julian_Day_Number
            my $a = ($month <= 2 ? 1 : 0);
            my $y = (2000 + $year) + 4800 - $a;
            my $m = $month + 12 * $a - 3;
            my $jdn = $day + int((153 * $m + 2) / 5) + 365 * $y + int($y / 4) - int($y / 100) + int($y / 400) - 32045;
            my $jdnWeekday = $jdn % 7 + 1;

            if ($weekday != $jdnWeekday) {
                printf "            ERROR: Weekday not correct for %02d.%02d.%04d (expected %s, got %s)\n",
                  $day, $month, (2000 + $year),
                  qw(Mon Tue Wed Thu Fri Sat Sun)[$jdnWeekday - 1],
                  qw(Mon Tue Wed Thu Fri Sat Sun)[$weekday    - 1];
                push @error, 'weekday-date';
            }

            if (not @error) {
              my $daytimeDecode = $hour * 60 + $minute;
              my $minutesSinceLastFromTime = int(($time - $timeDecodeLast) / 1000 / 60 + 0.5);

              if (defined $daytimeDecodeLast) {
                my $minutesSinceLastFromDaytime = ($daytimeDecode - $daytimeDecodeLast) % (24 * 60);

                if ($minutesSinceLastFromTime != $minutesSinceLastFromDaytime) {
                  printf "            ERROR: Time not in chronology with previous time (decoded \%+d min, real \%+d min)\n", $minutesSinceLastFromDaytime, $minutesSinceLastFromTime;
                  push @error, 'nonchronological';
                }
              }

              $timeDecodeLast = $time;
              $daytimeDecodeLast = $daytimeDecode;
            }

            printf "%11.3f:  decoded %-3s %02d.%02d.%02d %02d:%02d %s - %s\n",
              $time / 1000,
              qw(Mon Tue Wed Thu Fri Sat Sun)[$weekday - 1],
              $day, $month, $year,
              $hour, $minute,
              (defined($summertime) ? ($summertime ? 'CEST' : 'CET') : '???'),
              (@error ? sprintf('BAD %s', join(' ', @error)) : 'OK');

            if (@error) { $nDecodeBad += 1 } else { $nDecodeOk += 1 }
          }
          else {
            printf "%11.3f:  %s  ERROR: Incorrect number of bits (%d vs. 59)\n", $time / 1000, join('', @bit), scalar(@bit);
          }

          @bit = ();
          $nextPulseStartsMinute = FALSE;
        }

        # mostly 1-bits: short pulse (time code 0-bit)
        # mostly 0-bits: long  pulse (time code 1-bit)
        my $sumSamplePulseTrail = sum(@samplePulse[$nSampleLead + $nSamplePulseStart .. $#samplePulse]);
        push @bit, ($sumSamplePulseTrail > $thresholdZero ? 0 : 1);
      }

      printf "%11.3f:  edge: %s  pulse: %s  %s\n", $time / 1000,
        join('',
          (map { $_ ? '-' : 'X' } @sampleWindowAveragedLookbehind), '[',
          (map { $_ ? '-' : 'X' } @sampleWindowAveraged[0            .. $nSampleLead - 1]), '|',
          (map { $_ ? '-' : 'X' } @sampleWindowAveraged[$nSampleLead .. $#sampleWindowAveraged]), ']'),
        join('',
          (map { $_ ? '-' : 'X' } @samplePulse[0                                                    .. $nSampleLead                                         - 1]), '|',
          (map { $_ ? '-' : 'X' } @samplePulse[$nSampleLead                                         .. $nSampleLead + $nSamplePulseStart                    - 1]), '|',
          (map { $_ ? '-' : 'X' } @samplePulse[$nSampleLead + $nSamplePulseStart                    .. $nSampleLead + $nSamplePulseStart + $nSamplePulseEnd - 1]), '|',
          (map { $_ ? '-' : 'X' } @samplePulse[$nSampleLead + $nSamplePulseStart + $nSamplePulseEnd .. $#samplePulse])),
        ($nextPulseStartsMinute ? 'upcoming minute change' : sprintf('bit %2d = %d', scalar(@bit) - 1, $bit[-1]));

      $timeEdgeSpeculative = $time + 1000 + int($nSampleLead / 2 / $nSampleInSecond * 1000);
    }
  }
  else {
    my $msecSinceLastEdgeSpeculative = $time - $timeEdgeSpeculative;

    if ($msecSinceLastEdgeSpeculative >= 0) {
      $timeEdgeSpeculative += 1000;

      my $offset = int($nSampleLead / 2);

      printf "%11.3f:  edge: %s  speculative, %9.3f msec since last\n", $time / 1000,
        join('',
          (map { $_ ? '-' : 'X' } @sampleWindowAveragedLookbehind[0 .. $#sampleWindowAveragedLookbehind - $offset - 1]), '[',
          (map { $_ ? '-' : 'X' } @sampleWindowAveragedLookbehind[$#sampleWindowAveragedLookbehind - $offset .. $#sampleWindowAveragedLookbehind]),
          (map { $_ ? '-' : 'X' } @sampleWindowAveraged[0 .. $offset - 1]), '|',
          (map { $_ ? '-' : 'X' } @sampleWindowAveraged[$offset .. $#sampleWindowAveraged - $offset - 1]), ']',
          (map { $_ ? '-' : 'X' } @sampleWindowAveraged[$#sampleWindowAveraged - $offset .. $#sampleWindowAveraged])),
        ($time - $timeEdge) / 1000;
    }
  }

  delay(1000 / $nSampleInSecond);
}

END {
  print "\n";
  printf "INFO:  nDecodeOk  = %d\n", $nDecodeOk;
  printf "INFO:  nDecodeBad = %d\n", $nDecodeBad;
}


